I'm trying to understand the perspective of miners here too of course, it's an open discussion - but the change is made with the long term consideration about sustainability of the platform, not about short term alpha changes in price. If miners sell all or at margin that is completely at their discretion and not up to anyone but miners to decide, but at the very least this is less wasteful as a network.

Also- when we have a really popular new model severely rate limited we lose trust and usage from high-value customers, it's a real problem that is already happening. If you have idle GPUs let's get them serving real customers. This is our biggest problem at the moment really.

